def coordinates2nodes(xy):
    rounded_xy = round(xy*4)/4
    node_xy = int(rounded_xy/0.25)
    return node_xy

def nodes2coordinates(xy):
    coordinate_xy = xy/4
    return coordinate_xy

def paddedObstacle(position, groceryMatrix):
    node_x = coordinates2nodes(position[0])
    node_y = coordinates2nodes(position[1])
    groceryMatrix[node_y-1][node_x-1] = 0
    groceryMatrix[node_y-1][node_x] = 0
    groceryMatrix[node_y-1][node_x+1] = 0
    groceryMatrix[node_y][node_x-1] = 0
    groceryMatrix[node_y][node_x] = 0
    groceryMatrix[node_y][node_x+1] = 0
    groceryMatrix[node_y+1][node_x-1] = 0
    groceryMatrix[node_y+1][node_x] = 0
    groceryMatrix[node_y+1][node_x+1] = 0


def findPath(listOfTempObstacles, curr_position, target_position, grocery_matrix):
    for position in listOfTempObstacles:
        paddedObstacle(position, grocery_matrix)

    groceryGrid = Grid(matrix=grocery_matrix)

    curr_x = coordinates2nodes(curr_position[0])
    curr_y = coordinates2nodes(curr_position[1])
    target_x = coordinates2nodes(target_position[0])
    target_y = coordinates2nodes(target_position[1])

    start = groceryGrid.node(curr_x, curr_y)
    end = groceryGrid.node(target_x, target_y)

    finder = AStarFinder(diagonal_movement=DiagonalMovement.never)
    path, runs = finder.find_path(start, end, groceryGrid)

    #print('operations:', runs, 'path length:', len(path))
    #print(groceryGrid.grid_str(path=path, start=start, end=end))      # print the path

    return path, end, len(path)


def pathfinding_to_destination(listOfTempObstacles, curr_position, target_position, playerNumber, matrix):

    groceryMatrix_cart_w_obstacles = copy.deepcopy(matrix)  
   

    path, end, path_length = findPath(listOfTempObstacles, curr_position, target_position, groceryMatrix_cart_w_obstacles)

    if end != path[0]:
        # print("current position: ", nodes2coordinates(path[0].x), nodes2coordinates(path[0].y))
        # print("next position: ", nodes2coordinates(path[1].x), nodes2coordinates(path[1].y))

        #  Determine horizontal path
        if path[1].x < path[0].x:
            action = str(playerNumber) + " WEST"
        if path[1].x > path[0].x:
            action = str(playerNumber) + " EAST"
        #  Determine vertical path
        if path[1].y < path[0].y:
            action = str(playerNumber) + " NORTH"
        if path[1].y > path[0].y:
            action = str(playerNumber) + " SOUTH"
        if path[1].y == path[0].y and path[1].x == path[0].x:
            action = str(playerNumber) + " NOP"
    
        # print(action)

        sock_game.send(str.encode(action))  # send action to env

        
    else:
        print("destination reached!")
        return True

